              className="login-form-label"
            >
              <Input size="large" />
            </Form.Item>
          </Col>
        </Row>

        <Row xs={24} sm={20} md={16} lg={12} xl={10}>
          <Col >
            <Form.Item
              label="Password"
              name="password"
              rules={[
                { required: true, message: "Please input your password!" },
              ]}
              className="login-form-label"
            >
              <Input.Password size="large" />
            </Form.Item>
          </Col>
        </Row>

        <Row justify="center" align="middle" style={{ minHeight: "100%" }}>
          <Col >
